import { Suspense } from "react";
import { Outlet } from "react-router-dom";
import Sidebar from "./Sidebar/Sidebar";

const SharedLayout = ({ children }) => {
  return (
    <div>
      <Sidebar />
      <Suspense>
        <Outlet />
      </Suspense>
    </div>
  );
};

export default SharedLayout;
